Insert into RCInvoiceHist (select CONCAT('INV', floor(rand() * 100000)), d.D_Name, d.D_Ren_Dt,  Contact_NH, d.D_Holder, 'Advance', '15.00', d.D_Bill_Status, d.D_Reg_Dt, d.D_Ren_Dt - Interval 13 Month, 'Console', '2', '15.00' from Domain d LEFT JOIN Contact c on d.D_Name=c.D_Name and Type='B' LEFT JOIN InvoiceHist i on i.I_DName=d.D_Name and i.I_Inv_Dt > CURDATE() - Interval 1 Year LEFT JOIN RCInvoiceHist r on r.I_DName=d.D_Name and r.I_Inv_Dt > CURDATE() - Interval 1 Year where A_Number='601' and i.I_DName is NULL and r.I_DName is NULL and d.D_Bill_Status='Y');
Insert into ReceiptsHist (Select I_DName, I_Bill_NH, I_Inv_No, I_Inv_Dt, CONCAT('XYZ100-IEDR', floor(rand() * 1000000000000000)), '10.10.128.100', SUM(I_Batch_Total-I_Amount), I_Amount, I_Batch_Total, LAST_DAY(I_Inv_Dt), 'Cleardown' from RCInvoiceHist left join ReceiptsHist r on r.D_Name=I_DName where I_Bill_NH='XYZ100-IEDR' and I_Type='Advance' and r.D_Name is NULL GROUP by I_DName);
